import React from 'react';

export const Profile = (url, des, name, job) => {
    return (
        <> 
            {url ? (

                <div className='profile'>
                <img className='photo' 
                src={url}
                alt={des}
                />
                <h1>{name}</h1>
                <p>{job}</p>
            </div>) : (<div className='profile'>none!</div>)
                
            }
        </>
    )
};
